import React, {useState, useEffect} from 'react';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import './App.css';
import {Gallery, Footer, About, Detail} from "./components/";

function App() {
    const [time, setTime] = useState(0)
    useEffect(() => {
        fetch('/time').then(res => res.json()).then(data => {
            setTime(data.time);
        });
    }, []);




        return (
            <div>
            <Router>
                <Switch>
                    <Route path="/" exact component={()=><Gallery/>}/>
                    <Route path="/Prime Day Concerts" exact component={()=><Detail project={"pdc"}/>}/>
                    <Route path="/Oprah Favorite Things" exact component={()=><Detail project={"oft"}/>}/>
                    <Route path="/Flair" exact component={()=><Detail project={"flair"}/>}/>
                    <Route path="/Amazon Pets" exact component={()=><Detail project={"pets"}/>}/>
                </Switch>
            </Router>


                <Gallery />
                <About/>
                <Footer/>
            </div>
        )
}

export default App;
